import { useState } from "react";
import { StyledLoading } from './Components/Loader-style'

function App() {
  const [isLoading, setIsLoading] = useState(true)
  const mockURL = "http://localhost:8000/questions"
  let serverURL = "https://survey-api-dev.corp.getcentro.com/jsonrpc/";

  window.addEventListener('message', function(event) {
    if (event.data.source === "survey-parent" ) {
      serverURL = serverURL + event.data.value
      setIsLoading(false);
      console.log(serverURL)
    }
  }, false);

  return (

      <div style="background-color=blue;">
        {isLoading && <StyledLoading></StyledLoading>}
        {!isLoading && <StyledMainCard url={mockURL}></StyledMainCard>}
      </div>
  );
}

export default App;
